    description:
      "Find your perfect feline friend no matter where you are or what time it is.",
  },
  {
    id: 2,
    image: require("./assets/onboarding2.png"),
    title: "Support and Resources",
    description: "Join a community of cat lovers and experts.",
  },
  {
    id: 3,
    image: require("./assets/onboarding3.png"),
